INSERT INTO products_description VALUES("1289","645","1","Apple Earpods 1","<p>Revel in the latest advancements in the sound gear technology space with the Apple Wireless AirPods. These wireless headphones are going to change the way you listen to music forever. As soon as you take these AirPods out of the charging case and put them in your ears, there is an automatic connection. The music starts and the second you take them off, it stops. Communicating with your favorite personal assistant is a breeze with these Airpods. Double tap either of the AirPod to activate Siri, without requiring to take your iPhone out of your pocket. They are available in a classy white color.</p>","","0","","","","","","");
INSERT INTO products_description VALUES("1290","645","2","ابل ايربودز الإصدار الأول","<p>عش تجربة رائعة بأحدث وآخر التطورات في تقنية عالم الصوتيات مع سماعات الأذن ابل اير بودز اللاسلكية Apple Wireless AirPods. ستغير سماعات ابل اللاسلكية إلى الأبد الطريقة التي تستمع بها إلى الموسيقى. فحالما تخرج السماعات من محفظة الشحن الخاصة بها، وتضعها على اذنيك، ستستمتع باتصال اوتوماتيكي،بحيث سيبدا تشغيل الموسيقى على الفور، وعندما نزع السماعات من على أذنيك، ستتوقف الموسيقى. ستتمكن بسهولة من التواصل مع مساعدك الشخصي الصوتي المفضل لديك على هاتفك مع سماعات الاذن ابل. قم بالنقر بشكل مزدوج على احدى سماعات الاير بودز لتفعل المساعد الشخصي سيري Siri، بدون الحاجة إلى إخراج الايفون الخاص بك من جيبك. تتوفر سماعات الأذن ابل اير بودز باللون الأبيض الأنيق.</p>
INSERT INTO products_description VALUES("1291","646","1","Apple Earpods 2","<p>The new AirPods bear the same design as the first version, but Apple has provided the new generation or AirPods 2 with the H1 chip of its design instead of the W1 of the Apple Watch, which Apple says provides longer battery life, about 50% more than hours of voice calls compared to With the first generation, it also allows support for the Hey Siri feature, which enables the user to communicate directly by voice and request the implementation of voice commands via Siri, in addition to support for Bluetooth 5.0.</p>","","0","","","","","","");
INSERT INTO products_description VALUES("1292","646","2","ابل ايربودز الإصدار الثاني","<p>تحمل سماعات ايربودز الجديدة نفس تصميم الإصدار الأول تماما، لكن آبل زودت الجيل الجديد أو AirPods 2 برقاقة H1 من تصميمها بدلا من W1 الخاصة بساعة ابل الذكية&nbsp;<strong><a href=\\\"https://tech-echo.com/2018/09/apple-watch-series-4-features-price/\\\" target=\\\"_blank\\\">Apple Watch</a></strong>، والتي تقول آبل أنها توفر عمر بطارية أطول، حوالي 50% أكثر من ساعات المكالمات الصوتية مقارنة مع الجيل الأول، كما تتيح دعم ميزة Hey Siri التي تمكن المستخدم من التواصل صوتيا مباشرة وطلب تنفيذ الأوامر الصوتية عبر سيري، بالإضافة لدعم<strong><a href=\\\"https://tech-echo.com/2016/12/bluetooth-5-ready-to-use-features/\\\" target=\\\"_blank\\\">&nbsp;بلوتوث 5.0</a></strong>.</p>","","0","","","","","","");
