	<li>Xiaomi Mi 10T Mobile Specifications</li>
	<li>The mobile supports the installation of two SIM cards that support communication even 5G networks.</li>
	<li>The mobile comes with a distinctive design with glass materials in Dahr with an aluminum frame, weighing 216 grams.</li>
	<li>The back comes with a matte anti-fingerprint layer with a protection layer of the fifth generation Gorilla type.</li>
	<li>The phone comes in only two colors, black and silver.</li>
	<li>The screen comes from an IPS LCD type with a very small hole in the top left of the screen, and there is a protection layer on the screen from the fifth generation Gorilla Glass.</li>
	<li>The screen comes in a size of 6.7 inches, with FHD + quality, with a resolution of 1080 x 2400 pixels, with a density of 395 pixels per inch, with support for HDR10, and it also comes with a refresh rate of 144 Hz.</li>
	<li>The mobile processor is the most powerful Qualcomm Snapdragon 865 octa-core processor with 7 nano manufacturing technology with Adreno 650 graphic processor.</li>
	<li>The phone comes with the Android 10 operating system with the latest Xiaomi MIUI 12 interface.</li>
	<li>The mobile comes with an internal memory of 128 GB of the type UFS 3.1 with 8 GB of RAM, and the mobile does not support the installation of an external memory card.</li>
	<li>The front camera is 20 mega-pixels with an F / 2.2 lens slot, supports video shooting up to FHD quality.</li>
	<li>The rear camera is triple, where the main comes with a 64-megapixel camera with an F/1.9 lens slot, the second is a 13-megapixel Ultra Wide camera with an F/2.4 lens slot for wide-angle photography, and the third is a 5-megapixel macro camera with an F/2.4 lens slot for close-up photography, The cameras support video shooting up to 8K quality, and support the electronic stabilizer with 4K quality.</li>
